function SearchForm() {
    return (
        <div className="searchForm">
            <form action="" method="get">
                <input name="earchForm" placeholder="Фильм" type="search" />
                <button type="submit">Поиск</button>
            </form>
        </div>
    );
}

export default SearchForm;
